import { BrowserRouter } from "react-router-dom";
import { HomePage } from "./HomePage/HomePage";

const App = () => {
  return (
    <BrowserRouter>
    <Route exact path>

      <HomePage />
    </Route>
    </BrowserRouter>
  );
};

export { App };
